import { useState } from 'react';
import styled from 'styled-components';
const CountDiv = styled.div``;

const Counter01 = () => {
  const [value, setValue] = useState(1);
  return (
    <>
      <div>
        <h1>Counter01</h1>
        <strong>숫자 : {value}</strong>
        <button
          onClick={() => {
            setValue(value + 1);
          }}
        >
          PLUS
        </button>
      </div>
    </>
  );
};

export default Counter01;
